INSERT INTO `index_fulltext` VALUES
('230f8464c03ab1dc4fbd4bc332b6b776','Page A Page A\n             \n            \n         \n    \n         \n             \n                Page B  '),
('3e239e3d69de4b3b36fcd34479259a89','Sponsors Our companions and sponsors\r\n       \r\n    \r\n\r\n\n      \r\n\r\n\r\n\n     \n  \n\n\n\n                \n                 At FC Bigfoot, we are proud to have the backing of our dedicated supporters and companions. These valued partners play a crucial role in the success and growth of our club. Our supporters and companions share our vision and commitment to excellence, helping to foster a strong sense of community. Through their involvement, we are able to enhance our facilities, invest in youth development programs, and organize community outreach initiatives that make a positive impact. \n By partnering with FC Bigfoot, our supporters and companions benefit from increased visibility and association with a club that values openness, teamwork, and community spirit. We are grateful for their support and look forward to continuing our journey together, achieving new heights and celebrating many successes. \n Thank you to all our supporters and companions for being an integral part of the FC Bigfoot family. Your contributions make a significant difference, and we are proud to stand alongside you.  '),
