(1,12,1744014582,1744014582,0,0,0,0,'',256,'',0,0,0,0,NULL,'{\"fcbigfoot_file_link\":\"\"}',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'game_results',0,0,'','',0,'Our Game Results',0,'','','',NULL,0,0,0,0,0,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'table','file:13','','',0,0,0,11,NULL),
(2,12,1744014582,1744014582,0,0,0,0,'',128,'',0,0,0,0,NULL,'{\"CType\":\"\",\"colPos\":\"\",\"header\":\"\",\"header_layout\":\"\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"\",\"assets\":\"\",\"imagewidth\":\"\",\"imageheight\":\"\",\"imageborder\":\"\",\"imageorient\":\"\",\"imagecols\":\"\",\"image_zoom\":\"\",\"layout\":\"\",\"frame_class\":\"\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"sectionIndex\":\"\",\"linkToTop\":\"\",\"categories\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\",\"fe_group\":\"\",\"editlock\":\"\",\"rowDescription\":\"\"}',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'textpic',0,0,'','',0,'Our Game Results',2,'','','','<p>Stay updated with the latest scores and outcomes of FC Bigfoot\'s matches. Here, you will find a comprehensive list of our recent game results. Keep checking back for the most current information on our achievements.</p>',0,0,0,0,25,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'slider','','','',0,0,0,12,NULL),
(3,11,1744014582,1744014582,0,0,0,0,'',256,'',0,0,0,0,NULL,'{\"bodytext\":\"\"}',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'textpic',0,0,'','',0,'Our New Supporter',2,'','','','<p>We are thrilled to welcome <a href=\"https://typo3.org/\">TYPO3 Association</a> as our newest sponsor! This exciting partnership promises to elevate FC Bigfoot to even greater heights, both on and off the field. With TYPO3 Association\'s support, we look forward to enhancing our club\'s capabilities and achieving new milestones. Stay tuned for the amazing opportunities this collaboration will bring to our team and community.</p>\n\n',0,0,0,0,25,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'slider','','','',0,0,0,16,NULL),
(4,11,1744014582,1744014582,0,0,0,0,'',128,'',0,0,0,0,NULL,'{\"CType\":\"\",\"colPos\":\"\",\"header\":\"\",\"header_layout\":\"\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"\",\"assets\":\"\",\"imagewidth\":\"\",\"imageheight\":\"\",\"imageborder\":\"\",\"imageorient\":\"\",\"imagecols\":\"\",\"image_zoom\":\"\",\"layout\":\"\",\"frame_class\":\"\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"sectionIndex\":\"\",\"linkToTop\":\"\",\"categories\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\",\"fe_group\":\"\",\"editlock\":\"\",\"rowDescription\":\"\"}',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'textpic',0,0,'','',0,'Get Ready for Another Exciting Match!',2,'','','','<p>Mark your calendars for Thursday, April 18, 2024, at 16:30, as FC Bigfoot, currently third in the regional league, takes on our rivals from SurfCamp League. This is a match you won\'t want to miss!</p>\n<p><strong>Match Details</strong></p>\n<ul><li>Date and Time: Thursday, April 18, 2024, at 16:30</li><li>Teams: FC Bigfoot vs. SurfCamp League</li><li>Stadium Access: Gates open at 14:30</li><li>Catering: Food and beverages will be available</li></ul>\n<p>Join us for an afternoon of intense competition and cheer on FC Bigfoot as they strive to climb the league standings. Bring your friends and family for a memorable day of soccer excitement!</p>',0,0,0,0,25,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'slider','','','',0,0,0,15,NULL),
(5,11,1744014582,1744014582,0,0,0,0,'',64,'',0,0,0,0,NULL,'{\"CType\":\"\",\"colPos\":\"\",\"header\":\"\",\"header_layout\":\"\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"\",\"assets\":\"\",\"imagewidth\":\"\",\"imageheight\":\"\",\"imageborder\":\"\",\"imageorient\":\"\",\"imagecols\":\"\",\"image_zoom\":\"\",\"layout\":\"\",\"frame_class\":\"\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"sectionIndex\":\"\",\"linkToTop\":\"\",\"categories\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\",\"fe_group\":\"\",\"editlock\":\"\",\"rowDescription\":\"\"}',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'textpic',0,0,'','',0,'FC Bigfoot\'s 15th Charity Tournament',2,'','','','<p>FC Bigfoot proudly announces the 15th edition of our charity tournament! This beloved event unites soccer enthusiasts, players, and supporters from across the region for a day filled with thrilling matches and community spirit. For the 15th time, we host a marquee event showcasing local soccer talent and fierce competition. Teams from the region have confirmed their participation, promising an exciting display of sportsmanship and skill.</p>\n<p><strong>Bringing the Community Together</strong><br />Our charity tournament is more than just a series of soccer matches; it\'s a vibrant gathering point for all soccer fans in the region. It\'s a place where old friends reconnect, new friendships are built, and everyone can share in the collective joy of the sport. Whether you\'re a real soccer fan or someone who enjoys the lively atmosphere, there\'s something for everyone at our event. Beyond the action on the pitch, the tournament offers a perfect setting for families and friends to spend a memorable day together. As the matches unfold, spectators can enjoy a variety of food and beverage options, including the chance to relax and chat over a cold beer. There will be activities for children, ensuring that even the youngest fans have a great time.</p>\n<p><strong>Supporting a Worthy Cause</strong><br />At its heart, the charity tournament is about giving back to the community. Proceeds from the event will go towards local charities, supporting initiatives that make a real difference in the lives of those in need. By attending and participating, you\'re not only enjoying a fantastic day of soccer but also contributing to a greater cause.<br />Mark your calendars and gather your friends and family for an unforgettable day of soccer, fun, and community spirit. The 15th charity tournament hosted by FC Bigfoot is more than just an event; it\'s a celebration of everything we love about the game and the bonds it creates.</p>\n<p>We look forward to seeing you there, cheering on your favorite teams, enjoying the festivities, and being part of a tradition that continues to strengthen our community year after year. Let\'s make this 15th edition the best one yet!</p>',0,0,0,0,25,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'slider','','','',0,0,0,14,NULL),
(6,11,1744014582,1744014582,0,0,0,0,'',32,'',0,0,0,0,NULL,'{\"CType\":\"\",\"colPos\":\"\",\"header\":\"\",\"header_layout\":\"\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"\",\"assets\":\"\",\"imagewidth\":\"\",\"imageheight\":\"\",\"imageborder\":\"\",\"imageorient\":\"\",\"imagecols\":\"\",\"image_zoom\":\"\",\"layout\":\"\",\"frame_class\":\"\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"sectionIndex\":\"\",\"linkToTop\":\"\",\"categories\":\"\",\"sys_language_uid\":\"\",\"hidden\":\"\",\"starttime\":\"\",\"endtime\":\"\",\"fe_group\":\"\",\"editlock\":\"\",\"rowDescription\":\"\"}',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'textpic',0,0,'','',0,'News about our club',2,'','','','',0,0,0,0,25,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'slider','','','',0,0,0,13,NULL),
(7,10,1744014582,1744014582,0,0,0,0,'',256,'',0,0,0,0,NULL,'',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'textpic',0,0,'','',0,'2018 - 2024',2,'','','Becoming a community','<p>The biggest milestone was reached in 2018 when FC Bigfoot was promoted to the regional league for the first time. This achievement marked a turning point in the club\'s history. The promotion brought a new level of visibility and prestige, attracting more fans and support from the local community.</p>\n<p>Since then, FC Bigfoot has continued its success, not only maintaining its status in the regional league but also expanding its influence nationally. The club\'s strategic focus on youth development has been a cornerstone of this growth. By investing in state-of-the-art training facilities and nurturing young talent through comprehensive development programs, FC Bigfoot has established a strong pipeline of skilled players.</p>\n<p>FC Bigfoot has solidified its position as a prominent and influential football club, known for its dedication to both competitive success and community engagement. The club\'s ongoing commitment to youth development and national expansion ensures that its legacy will continue to grow in the years to come.</p>',0,0,0,0,25,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'slider','','','',0,0,0,21,NULL),
(8,10,1744014582,1744014582,0,0,0,0,'',128,'',0,0,0,0,NULL,'',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'textpic',0,0,'','',0,'2005 - 2018',2,'','','Growth, growth, growth!','<p>FC Bigfoot was able to expand during this era, marking a significant period of growth and development for the club. Beyond competing in the classic league, FC Bigfoot became known for its community-oriented approach. The club organized various local events and initiatives that engaged the community, fostering a strong bond between the club and its supporters.</p>\n<p>FC Bigfoot also emphasized inclusivity, ensuring that everyone, regardless of gender or background, had the opportunity to be part of the club. This inclusive approach, combined with their community-focused initiatives, solidified FC Bigfoot’s reputation as a forward-thinking and community-oriented club.</p>',0,0,0,0,25,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'slider','','','',0,0,0,20,NULL),
(9,10,1744014582,1744014582,0,0,0,0,'',64,'',0,0,0,0,NULL,'',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'textpic',0,0,'','',0,'2001 - 2004',2,'','','Our first years','<p>FC Bigfoot was established in 2001 and swiftly became a well-known name in the local football community. In its early days, the team had to practice on a worn-out field with barely enough equipment for all the players. Despite these challenges, they showed remarkable persistence.</p>\n<p>One memorable incident occurred during their first season. In a match against a more experienced team, FC Bigfoot was down by four goals at halftime. Instead of giving up, they rallied together and, with sheer determination and teamwork, managed to tie the game by the final whistle. This game became a turning point for the club, showcasing their spirit and winning the respect of fans and competitors alike. From that day on, FC Bigfoot was known for its fighting spirit.</p>',0,0,0,0,25,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'slider','','','',0,0,0,19,NULL),
(10,10,1744014582,1744014582,0,0,0,0,'',32,'',0,0,0,0,NULL,'',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'textpic',0,0,'','',0,'From foundation to the regional league',2,'','','','<p>Our history is a testament to resilience and triumph. From humble beginnings to remarkable achievements, each chapter tells a story of dedication, teamwork, and community support. FC Bigfooot is a club at heart with a focus on cohesion and mutual support. The club may only have a comparatively short 23-year history, but it has a lively history with many ups and downs. You can find out more here.</p>',0,0,0,0,25,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'slider','','','',0,0,0,18,NULL),
(11,9,1744014582,1744014582,0,0,0,0,'',256,'',0,0,0,0,NULL,'{\"pi_flexform\":\"\"}',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'form_formframework',0,0,'','',0,'',2,'','','',NULL,0,0,0,0,0,0,0,2,'',0,'',0,'',1,0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"settings.persistenceIdentifier\">\n                    <value index=\"vDEF\">EXT:fcbigfoot/Configuration/Form/FormDefinitions/applicationForm.form.yaml</value>\n                </field>\n                <field index=\"settings.overrideFinishers\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>','0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'slider','','','',0,0,0,26,NULL),
(12,9,1744014582,1744014582,0,0,0,0,'',128,'',0,0,0,0,NULL,'',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'textpic',0,0,'','',0,'Become a Member today',2,'','','','<p>Join the FC Bigfoot community by becoming a member today! Our membership program offers a variety of benefits designed to enhance your experience and connection with the club. As a member, you\'ll enjoy exclusive perks, including early access to tickets, discounts on merchandise, and invitations to special events.</p>\n<p>Membership also provides you with the opportunity to be more involved with the club, from participating in member-only meetings to having a say in club decisions. Whether you\'re a lifelong supporter or new to the FC Bigfoot family, our membership program is a great way to show your support and stay engaged with all the exciting developments at the club.</p>\n<p>Sign up now and be a part of the FC Bigfoot legacy, contributing to our community. Together, we can achieve great things both on and off the field.</p>',0,0,0,0,25,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'slider','','','',0,0,0,22,NULL),
(13,6,1744014582,1744014582,0,0,0,0,'',256,'',0,0,0,0,NULL,'{\"fcbigfoot_persons\":\"\"}',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'persons_overview',0,0,'','',0,'The Team',2,'','','',NULL,0,0,0,0,0,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'slider','','','',8,0,0,17,NULL),
(14,5,1744014582,1744014582,0,0,0,0,'',256,'',0,0,0,0,NULL,'',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'textpic',0,0,'','',0,'Our companions and sponsors',2,'','','','<p>At FC Bigfoot, we are proud to have the backing of our dedicated supporters and companions. These valued partners play a crucial role in the success and growth of our club. Our supporters and companions share our vision and commitment to excellence, helping to foster a strong sense of community. Through their involvement, we are able to enhance our facilities, invest in youth development programs, and organize community outreach initiatives that make a positive impact.</p>\n<p>By partnering with FC Bigfoot, our supporters and companions benefit from increased visibility and association with a club that values openness, teamwork, and community spirit. We are grateful for their support and look forward to continuing our journey together, achieving new heights and celebrating many successes.</p>\n<p>Thank you to all our supporters and companions for being an integral part of the FC Bigfoot family. Your contributions make a significant difference, and we are proud to stand alongside you.</p>',0,0,0,0,25,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'slider','','','',0,0,0,23,NULL),
