(18,1,1744014582,1744014582,0,0,0,0,'',256,'',0,0,0,0,NULL,'{\"fcbigfoot_buttons\":\"\"}',0,0,0,0,'default',3,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'cta',0,0,'','',0,'Let\'s keep in touch',2,'','','Game on',NULL,0,0,0,0,0,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,2,'slider','','','',0,0,0,2,NULL),
(19,1,1744014582,1744014582,0,0,0,0,'',128,'',0,0,0,0,NULL,'{\"fcbigfoot_sponsors\":\"\"}',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'sponsors',0,0,'','',0,'Our biggest supporters',2,'','','',NULL,0,0,0,0,0,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'slider','','','',0,6,0,10,NULL),
(20,1,1744014582,1744014582,0,0,0,0,'',64,'',0,0,0,0,NULL,'{\"hidden\":\"\"}',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'textpic',0,0,'','',0,'Our Core Values',2,'','','','<p>At FC Bigfoot, our values guide everything we do, both on and off the field. We are dedicated to fostering a community that embodies the spirit of football through trust, respect, openness, sharing, friendship, and fun.</p>\n<p><strong>Trust and Respect</strong><br />We trust and respect every individual within our club—players, coaches, staff, and supporters. Everyone\'s contributions are valued, creating a strong, cohesive team.</p>\n<p><strong>Openness</strong><br />Our inclusive and welcoming community embraces diversity. We ensure that everyone feels valued and included, fostering a sense of belonging through transparent and honest communication.</p>\n<p><strong>Sharing</strong><br />Collaboration is key at FC Bigfoot. Sharing knowledge, skills, and experiences makes us stronger, inspiring the next generation of players and fans.</p>\n<p><strong>Friendship and Fun</strong><br />Football is about building friendships and creating memories. We prioritize camaraderie and enjoyment, believing that a positive and fun atmosphere leads to better performance and a more fulfilling experience.</p>\n<p>FC Bigfoot is more than a club—we are a community built on shared values. Trust, respect, openness, sharing, friendship, and fun define us. Join us at FC Bigfoot, where values matter and every member is celebrated.</p>',0,0,0,0,25,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'slider','','','',0,0,0,3,NULL),
