(22,1,1744014582,1744014582,0,0,0,0,'',16,'',0,0,0,0,NULL,'{\"image\":\"\"}',0,0,0,0,'default',0,NULL,'','',NULL,'1.3333333333333',10,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','','',0,0,0,0,0,0,'default','','',0,NULL,2,'textpic',0,0,'','',0,'Your City. Your Club.',2,'','','','<p>With 21 teams, we are once again one of the largest clubs in Fuerteventura this season! We have three senior teams in each age group and at least two youth teams in each age group. In total, we have almost 900 members. We would like to thank everyone who has supported us so actively this season.</p>',1,1,0,0,26,0,0,2,'',0,'',0,'',1,0,NULL,'0','',0,0,'',124,0,0,0,'',0,'','','',0,0,0,'slider','','','',0,0,0,5,NULL),
