> element.\n</p>\n\n\n<h2>Lists</h2>\n\n<p>This is a paragraph before an <strong>unnumbered</strong> list (<code>ul</code>). Lorem ipsum dolor sit amet, consectetuer\n    adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat.</p>\n\n<ul>\n    <li>One.</li>\n    <li>Two.</li>\n    <li>Three. Well, probably this list item should be longer. Note that for short items lists look better if they are compactly\n        presented, whereas for long items, it would be better to have more vertical spacing between items.</li>\n    <li>Four. This is the last item in this list. Let us terminate the list now without making any more fuss about it.</li>\n</ul>\n\n<p>This is a paragraph before a <strong>numbered</strong> list (<code>ol</code>). Note that the spacing between a paragraph\n    and a list before or after that is hard to tune in a user style sheet. You can\'t guess which paragraphs are logically\n    related to a list, e.g. as a \"list header\".</p>\n\n<ol>\n    <li>One.</li>\n    <li>Two.</li>\n    <li>Three. Well, probably this list item should be longer. Note that if items are short, lists look better if they are compactly\n        presented, whereas for long items, it would be better to have more vertical spacing between items.</li>\n    <li>Four. This is the last item in this list. Let us terminate the list now without making any more fuss about it.</li>\n    <li>Five</li>\n    <li>Six</li>\n    <li>Seven</li>\n    <li>Eight</li>\n    <li>Nine</li>\n    <li>Ten</li>\n\n</ol>\n\n<p>This is a paragraph before a <strong>definition</strong> list (<code>dl</code>). In principle, such a list should consist\n    of <em>terms</em> and associated definitions. Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy\n    nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat. </p>\n<dl>\n    <dt>Apple</dt>\n    <dd>is a fruit.</dd>\n    <dt>Banana</dt>\n    <dd>Is also a fruit.</dd>\n    <dt>Tomato</dt>\n    <dd>Is debatable. Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet\n        dolore magna aliquam erat volutpat.</dd>\n</dl>\n\n<h2>Text-level markup</h2>\n\n\n<ul>\n    <li> <abbr title=\"Cascading Style Sheets\">CSS</abbr> (an abbreviation;\n        <code>abbr</code> markup used)</li>\n    <li> <acronym title=\"radio detecting and ranging\">radar</acronym> (an acronym; <code>acronym</code> markup used)</li>\n\n    <li> <cite>Origin of Species</cite> (a book title; <code>cite</code> markup used)</li>\n    <li> <code>a[i] = b[i] + c[i);</code> (computer code; <code>code</code> markup used)</li>\n\n    <li> an <dfn>octet</dfn> is an entity consisting of eight bits (\n        <code>dfn</code> markup used for the term being defined)</li>\n    <li> this is <em>very</em> simple (<code>em</code> markup used for emphasizing a word)</li>\n\n    <li> type <kbd>yes</kbd> when prompted for an answer (<code>kbd</code> markup used for text indicating keyboard input)</li>\n    <li> <q>Hello!</q> (<code>q</code> markup used for quotation)</li>\n\n    <li> He said: <q>She said <q>Hello!</q></q> (a quotation inside a quotation)</li>\n    <li> you may get the message <samp>Core dumped</samp> at times (\n        <code>samp</code> markup used for sample output)</li>\n\n    <li> <strong>this is highlighted text</strong> (<code>strong</code> markup used)</li>\n\n    <li> <tt>text in monospace font</tt> (<code>tt</code> markup used)</li>\n\n    <li> the command <code>cat</code> <var>filename</var> displays the file specified by the <var>filename</var> (<code>var</code>        markup used to indicate a word as a variable).</li>\n    <li> In order to test how subscripts and superscripts (<code>sub</code> and <code>sup</code> markup) work inside running text,\n        we need some dummy text around constructs like x<sub>1</sub> and H<sub>2</sub>O (where subscripts occur). So here\n        is some fill so that you will (hopefully) see whether and how badly the subscripts and superscripts mess up vertical\n        spacing between lines. Now superscripts: M<sup>lle</sup>, 1<sup>st</sup>, and then some mathematical notations: e<sup>x</sup>,\n        sin<sup>2</sup> <i>x</i>, and some nested superscripts (exponents) too: Lorem ipsum dolor sit amet, consectetuer\n        adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat. Ut wisi enim\n        ad minim veniam, quis nostrud exerci tation ullamcorper suscipit lobortis nisl ut aliquip ex ea euismod tincidunt\n        ut laoreet dolore magna aliquam erat volutpat. </li>\n\n</ul>\n\n<p>Some of the elements tested above are typically displayed in a monospace font, often using the <em>same</em> presentation\n    for all of them. This tests whether that is the case on your browser:</p>\n\n<ul>\n    <li><code>This is sample text inside code markup</code></li>\n    <li><kbd>This is sample text inside kbd markup</kbd></li>\n    <li><samp>This is sample text inside samp markup</samp></li>\n\n    <li><tt>This is sample text inside tt markup</tt></li>\n</ul>\n\n<h2>Links</h2>\n\n<ul>\n    <li><a href=\"http://http:///web/20110926020946/http://developer.yahoo.com/yui\">developer.yahoo.com/yui</a></li>\n    <li><a href=\"http://http:///web/20110926020946/http://yuiblog.com/\">the YUI Blog</a></li>\n</ul>\n\n\n<h2>Tables</h2>\n\n<p>The following table has a caption. The first row and the first column contain table header cells only; other cells are data\n    cells.</p>\n\n<table summary=\"each row names a nordic country and specifies its total area and land area, in square kilometers\">\n    <caption>Caption: Sample table: Areas of the Nordic countries, in sq km</caption>\n    <tr>\n        <th>Country</th>\n        <th>Total area</th>\n\n        <th>Land area</th>\n    </tr>\n    <tr>\n        <th>Denmark</th>\n        <td>43,070</td>\n        <td>42,370</td>\n    </tr>\n    <tr>\n\n        <th>Finland</th>\n        <td>337,030</td>\n        <td>305,470</td>\n    </tr>\n    <tr>\n        <th>Iceland</th>\n        <td>103,000</td>\n\n        <td>100,250</td>\n    </tr>\n    <tr>\n        <th>Norway</th>\n        <td>324,220</td>\n        <td>307,860</td>\n    </tr>\n\n    <tr>\n        <th>Sweden</th>\n        <td>449,964</td>\n        <td>410,928</td>\n    </tr>\n</table>\n\n<h2>Forms</h2>\n\n<form action=\"/web/20110926020946/http://www.cs.tut.fi/cgi-bin/run/~jkorpela/echo.cgi\">\n\n    <div><input type=\"hidden\" name=\"hidden field\" value=\"42\"></div>\n    <div><label for=\"f1\">Single-line text input field: <input id=\"f1\" name=\"text\" size=\"20\" value=\"Default text.\"></label></div>\n    <div><label for=\"f2\">Multi-line text input field (textarea):</label></div>\n    <div><textarea id=\"f2\" name=\"textarea\" rows=\"16\" cols=\"20\">Default text.</textarea></div>\n\n    <p>The following two radio buttons are inside <code>fieldset</code> element with a <code>legend</code>:</p>\n\n\n    <fieldset>\n        <legend>Legend</legend>\n        <div>\n            <label for=\"f3\">Radio button 1</label>\n            <input id=\"f3\" type=\"radio\" name=\"radio\" value=\"1\">\n        </div>\n        <div>\n            <label for=\"f4\">Radio button 2 (initially checked)</label>\n\n            <input id=\"f4\" type=\"radio\" name=\"radio\" value=\"2\" checked>\n        </div>\n    </fieldset>\n\n    <fieldset>\n        <legend>Check those that apply</legend>\n        <div>\n            <label for=\"f5\">Checkbox 1</label>\n\n            <input id=\"f5\" type=\"checkbox\" name=\"checkbox\">\n        </div>\n        <div>\n            <label for=\"f6\">Checkbox 2 (initially checked)</label>\n            <input id=\"f6\" type=\"checkbox\" name=\"checkbox2\" checked>\n        </div>\n    </fieldset>\n\n    <p>\n\n        <label for=\"f10\">A <code>select</code> element with <code>size=\"1\"</code> (dropdown box):</label>\n    </p>\n\n    <select id=\"f10\" name=\"se